import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min.js';
import React from "react";
//import Navbar from "./Navbar";
import "./Login.css";


function Signup() {
    return (
        <>
<div className="Sign"></div>
            <div className="signup">
                <div className="row">
                    <h3 style={{marginBottom:"30px"}}>SignUp</h3>
                    <div className="col-sm-12 col-md-6 col-lg-6 signupcon">
                        <input className="form-control signupcon" type="text" placeholder="First Name" />
                    </div>
                    <div className="col-sm-12 col-md-6 col-lg-6 signupcon">
                        <input className="form-control" type="text" placeholder="Last Name" />
                    </div>
                    <div className="col-sm-12 col-md-12 col-lg-12 signupcon">
                        <input className="form-control" type="text" placeholder="Enter Your Email Here..." />
                    </div>
                    <div className="col-sm-12 col-md-12 col-lg-12 signupcon">
                        <input className="form-control" type="text" placeholder="Enter Your Phone Number Here... " />
                    </div>

                    <div className="col-sm-12 col-md-6 col-lg-6 signupcon">
                        <input className="form-control signupcon" type="text" placeholder="Password" />
                    </div>
                    <div className="col-sm-12 col-md-6 col-lg-6 signupcon">
                        <input className="form-control signupcon" type="text" placeholder="Conform Password" />
                    </div>
                    <div>
                        <button type="button" className="btn btn-primary">Submit</button>
                    </div>
                </div>
            </div>
        </>
    );
}
export default Signup;
